// Example 1:
//
// Input: s = "abbcccaa"
// Output: 13
// Explanation: The homogenous substrings are listed as below:
// "a"   appears 3 times.
// "aa"  appears 1 time.
// "b"   appears 2 times.
// "bb"  appears 1 time.
// "c"   appears 3 times.
// "cc"  appears 2 times.
// "ccc" appears 1 time.
// 3 + 1 + 2 + 1 + 3 + 2 + 1 = 13.

use std::time::{Duration, Instant};

use bullitt::homogenous_substring::count_homogenous;

fn main() {
    let start: Instant = Instant::now();
    dbg!(count_homogenous(String::from("abbcccaa")));
    dbg!(count_homogenous(String::from("xy")));
    dbg!(count_homogenous(String::from("yyyyy")));
    dbg!(count_homogenous(String::from("")));

    let duration: Duration = start.elapsed();
    println!("Time elapsed is: {:?}", duration);
}
